import React from 'react';
import Skills from "./Skills";
import NavigationBar from "./NavigationBar";
import Footer from "./Footer";

import './style/App.css';
import './style/SkillPage.css';

class SkillPage extends React.Component {
    render() {
        return (
          <div className="global">
              <NavigationBar/>
              <Skills/>
              <div className="align-self-center" >
                  <div className="skill-row" style={{display: 'inline'}}>
                      <p className="skill-title" style={{float: 'left'}}>Languages:</p>
                      <p className="skill-content" style={{marginLeft: '2em',float: 'right'}}>C, SQL, Java, Python, Shell Script, Javascript, Eiffel, Assembly, Verilog, HTML5, CSS</p>
                  </div>
                  <div className="skill-row" style={{display: 'inline'}}>
                      <p className="skill-title" style={{float: 'left'}}>Platforms:</p>
                      <p className="skill-content" style={{marginLeft: '2em',float: 'right'}}>Linux, Windows (Desktop and Mobile), Android, iOS</p>
                  </div>
              </div>
              <Footer/>
          </div>
        );
    }
}

export default SkillPage;
